    let countList = count.split('').reverse();
    console.log(countList)
    return (
        <FooterContainer>
        <CountTitle>
            <p>View Count</p>
        </CountTitle>
        <ViewCountContainer>
            <CountBox>
                <p id="hundred">{count}</p>
            </CountBox>
            <CountBox>
                <p id="tenth"></p>
            </CountBox>
            <CountBox>
                <p id="ones"></p>
            </CountBox>
        </ViewCountContainer>
    </FooterContainer>
    )
}

export default Footer;
